import React from 'react';
import Contact from './Contact';
import swamijiDetails from './KashiMathHeads';

function PropLearning(){

  const mathHeadDetails = swamijiDetails.map(swamiji => <Contact
     key = {swamiji.key}
     image = {swamiji.image}
     name = {swamiji.name}
     phone = {swamiji.phone}
     email = {swamiji.phone} />)

  return(
    <div>


      {mathHeadDetails}



    </div>
  );
}

export default PropLearning;
